import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

import * as adminApi from "../../../api/admin"

export default function SeasonsItems(props) {
    const months = ["Januar"]

    const {
        SEASON_END_DAY,
        SEASON_END_MONTH,
        SEASON_ID,
        SEASON_NAME,
        SEASON_START_DAY,
        SEASON_START_MONTH
    } = props

    console.log(props)

    return (
        <React.Fragment>
            <Card sx={{ maxWidth: 345 }}>
                <CardContent>
                    <Typography gutterBottom variant="h5" component="div">
                        {SEASON_NAME}
                    </Typography>

                    <Typography>
                        Starting Date:
                    </Typography>
                </CardContent>
                <CardActions>
                    <Button 
                        size="small" 
                        // onClick={handleClickOpen}
                    >
                        Edit
                    </Button>
                    <Button 
                        size="small" 
                        color="error" 
                        // onClick={handleClickOpenDelete} 
                        >
                        Delete
                    </Button>
                </CardActions>
            </Card>
        </React.Fragment>
    )
}
